// Collision Colliders
export function handleCollisionColliders(scene, allLayers){
    // // console.log(allLayers)
    for(const layer in allLayers){
        // console.log(layer)
        if (allLayers.hasOwnProperty(layer)) {
            console.log(layer)
            scene.physics.add.collider(scene.player, allLayers[layer]);
        }
    }
}
